import React from "react";
import styles from './Place.module.css';

class Store extends React.Component {
    render() {
        return (
            <div>

            </div>
        );
    }
}

class Info extends React.Component {
    render() {
        return (
            <div>

            </div>
        );
    }
}

class Place extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            store: true
        }
    }

    render() {
        return (
            <div>
                <header></header>
                <div className={styles.place_header}>
                    <img src="place.jpeg" alt="PuertoNorte" />
                    <div>
                        <p>Puerto Norte</p>
                        <button type="button" className="btn btn-danger">Suscribirse</button>
                    </div>
                </div>
                <div className="btn-group place_options" role="group" aria-label="Basic radio toggle button group">
                    <input type="radio" class="btn-check" name="btnradio" id="btnradio1" autocomplete="off" checked />
                    <label className="btn btn-outline-primary" for="btnradio1">Tienda</label>

                    <input type="radio" class="btn-check" name="btnradio" id="btnradio3" autocomplete="off" />
                    <label className="btn btn-outline-primary" for="btnradio3">Info</label>
                </div>

                <div className={styles.place_options}>
                    {this.state.place ?
                        <Store />
                        :
                        <Info />}
                </div>
            </div>
        );
    }
}

export default Place;
